import { Outlet } from "react-router-dom";
import "bootstrap/js/src/collapse.js";

const Layout = () => {
    return (
        <>
            <nav class="navbar navbar-expand-lg navbar-light bg-light">
                <a class="navbar-brand" href="#">Navbar</a>
                <button class="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarNavAltMarkup" aria-controls="navbarNavAltMarkup" aria-expanded="false" aria-label="Toggle navigation">
                    <span class="navbar-toggler-icon"></span>
                </button>
                <div class="collapse navbar-collapse" id="navbarNavAltMarkup">
                    <div class="navbar-nav">
                        <a class="nav-item nav-link active" href="#" eventkey="1">Home <span class="sr-only">(current)</span></a>
                        <a class="nav-item nav-link" href="#" eventkey="2">Features</a>
                        <a class="nav-item nav-link" href="#" eventkey="3">Pricing</a>
                        <a class="nav-item nav-link disabled" href="#" eventkey="4">Disabled</a>
                    </div>
                </div>
            </nav>

            <Outlet />
        </>
    )
};

export default Layout;
